script: |
  super -f text -I q9376.spq | sort > q9376.out

inputs:
  - name: q9376.spq
    data: |
      SELECT - col0 / + 56 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 * + + col0 + + - col1 >= + - 39 + - col1;
  - name: tab1

outputs:
  - name: q9376.out
    data: |
      -1
      -1
      0
